import React, {useState} from "react";
import "./css/homepage.css"

function Homepage () {
    const [users, setUsers] = useState(null);
    useEffect(() => {
        const configuration = {
            method: "post",
            url: "http://localhost:4000/users",
          };
          axios(configuration)
          .then((result) => {
            setUsers(result);
          })
          .catch((error) => {
            error = new Error();
          });
        setTimeout(() => {
          setCount((count) => count + 1);
        }, 1000);
      });
    

    return(
        <div className="homebody">
            <h1>Home Page</h1>
            {
                users.map = (users) => {
                    users.result.email;

                }
            }

        </div>
    )
}

export default Homepage;
